/*
https://leetcode.com/problems/is-subsequence/
 */

public class Main {
    public static boolean isSubsequence(String s, String t) {
        if (s.isEmpty())
            return true;
        if (t.isEmpty())
            return false;

        for (int i = 0; i < s.length(); i++) {
            boolean found = false;
            for (int j = 0; j < t.length(); j++) {
                if (s.charAt(i) == t.charAt(j)) {
                    t = t.substring(j + 1);
                    found = true;
                    break;
                }
            }

            if (!found)
                return false;
        }

        return true;
    }

    public static void main(String[] args) {
        String s1 = "abc", t1 = "ahbgdc";
        String s2 = "axc", t2 = "ahbgdc";
        String s3 = "", t3 = "ahbgdc";
        String s4 = "aaaaaa", t4 = "bbaaaa";
        String s5 = "leeeeetcode", t5 = "";

        System.out.println(isSubsequence(s1, t1));
        System.out.println(isSubsequence(s2, t2));
        System.out.println(isSubsequence(s3, t3));
        System.out.println(isSubsequence(s4, t4));
        System.out.println(isSubsequence(s5, t5));
    }
}
